import React from "react";

export const Footer = ({ isMenuOpened }) => {
    return (
        <div className={!isMenuOpened ? "footer" : "hidden"}>
            <div class="upper-footer">
                <h4 className="footer-contacts-title">Contatti</h4>
                <p class="footer-contacts-address"> <b>Indirizzo</b>: Via del Mare, Favignana</p>
                <p> Telefono:
                    <a class="footer-contacts-phone" href="tel:3927252398">392 725 2398</a>
                </p>
                <p class="footer-contacts-email">Email: info@favignanabb.com</p>
            </div>
            <div class="bottom-footer">
                <div class="footer-copyright">
                    <p>&copy; 2024 Favignana B&B <br /> Tutti i diritti riservati.</p>
                </div>
            </div>
        </div>
    );
};
